import React from 'react';
import { connect } from 'react-redux';
import { addMake } from '../redux/Form';

const Make = (props) => {
    return (
        <div className="option-container">
            {props.blackCar.drilldown.class_list.map(list => list.year_list.map(year => year.make_list.map(make => (<option className="option" onClick={props.handleOptionClick} key={make.name} value={make.name} name="make"> {make.name} </option> ))))}
        </div>
    )
}

export default Make;
